def parse_args():
    parser = argparse.ArgumentParser(
        description='json annotation generator for NIA Sidewalk Dataset')
    parser.add_argument(
        '--dataset_type',
        choices=['bbox', 'polygon'],
        help='target dataset to convert')
    args = parser.parse_args()
    return args


